import React from "react";

function Services() {
  const services = [
    { title: "Aadhaar Services", description: "Update or apply for your Aadhaar card." },
    { title: "PAN Card", description: "Apply for a new PAN card or updates." },
    { title: "Utility Bill Payments", description: "Pay electricity, water, and mobile bills." },
    { title: "Government Forms", description: "Submit forms for various government schemes." },
  ];

  return (
    <section className="container mx-auto py-12">
      <h2 className="text-3xl font-bold text-center mb-6">Our Services</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {services.map((service, index) => (
          <div key={index} className="bg-white shadow-md rounded-lg p-4">
            <h3 className="text-xl font-semibold">{service.title}</h3>
            <p className="text-gray-600">{service.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Services;
